    SELECT ?childRoyalty, ?parent AS parentOfChild, ?officeHolder AS officeHolderOfChild WHERE 
    { ?childRoyalty <http://dbpedia.org/ontology/parent> ?parentOfChild . ?parentOfChild <http://dbpedia.org/property/child> ?childRoyalty }
) AS childRoyalties
JOIN (
    SELECT ?officeHolder AS officeHolder WHERE 
    { <http://dbpedia.org/resource/William_I_(England)> <http://dbpedia.org/property/officeHolder> ?officeHolder }
) AS officeHolders ON childRoyalties.childRoyalty = officeHolders.officeHolder

# Link to Roger II of Sicily's child royalty
JOIN (
    SELECT ?childRoyalty AS childRoyaltyOfRoger WHERE 
    { <http://dbpedia.org/resource/Roger_II_of_Sicily> <http://dbpedia.org/ontology/child> ?childRoyaltyOfRoger }
) AS childRoyaltyOfRoger ON childRoyalties.childRoyalty = childRoyaltyOfRoger.childRoyalty

# Final result
WHERE {
    ?result1 = ?childRoyaltyOfRoger .
    ?result2 = ?childRoyalty
}

