Given the complexity of the relationships and the need to identify specific individuals who meet these criteria, a SPARQL query would be designed to traverse the relevant ontologies and inferential relationships. However, constructing such a query requires detailed knowledge of the schema used to model these relationships in the dataset.

Here's a simplified conceptual approach to how one might start to formulate the query:

```sql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#
PREFIX owl: <http://www.w3.org/2002/07/owl#

SELECT ?child
WHERE {
  ?royaltyParent a owl:NamedIndividual ;
                 rdf:type owl:Royalty ;
                 rdfs:father ?parentOfChild .

  ?parentOfChild a owl:NamedIndividual ;
                  rdf:type owl:Person ;
                  rdfs:child ?child .

  ?child a owl:NamedIndividual ;
           rdf:type owl:Royalty ;
           rdf:type owl:OfficeHolder .

  ?royaltyFather a owl:NamedIndividual ;
                 rdf:type owl:Royalty ;
                 rdfs:father ?child'sFather .

  ?child'sFather a owl:NamedIndividual ;
               rdf:type owl:Person ;
               rdfs:parent ?parentOfChild .
}

```

This query is highly simplified and assumes a direct mapping of properties to classes, which may not accurately reflect the complexity of familial relationships and titles. In reality, the schema might require more nuanced queries involving additional properties and constraints to accurately identify the child in question.

